import React, { useEffect } from 'react';
import planeImage from '/Users/mehreenaiman/Documents/GitHub/FlightForesight/API Model Deployment/flight-foresight/src/images/kisspng-airplane-mode-computer-icons-plane-5acdf256b24965.6757273115234463587303.png';

const BackgroundTravelWebsite = () => {
    // Apply body styles on mount
    useEffect(() => {
        document.body.style.backgroundColor = 'rgb(255, 255, 255)'; // Sky blue
        document.body.style.fontFamily = 'Arial, sans-serif';
        document.body.style.margin = '0';
        document.body.style.padding = '0';
        document.body.style.color = '#333';
    }, []); // Empty dependency array means it runs only once when the component mounts

    return (
        <div>
            {/* Header section */}
            <div style={{
                backgroundColor:'rgb(220, 244, 253)',  
                color: '#000000',            
                textAlign: 'left',
                paddingLeft: '20px',
                display: 'flex',
                alignItems: 'center',
                padding: '10px',             // Add padding around the header for spacing
                borderBottom: '2px solid #000000' // Thin black line under the header

            }}>
                <img 
                    src={planeImage} 
                    alt="JetSet" 
                    style={{
                        width: '40px', 
                        height: 'auto', 
                        transform: 'rotate(270deg)',  // Rotate the image
                        marginRight: '20px'    // Adds spacing between image and text
                    }} 
                />
                <h1 style={{ fontSize: '40px' }}>jetSet</h1>       
            </div>
        </div>
    );
};

export default BackgroundTravelWebsite;
